import React from 'react';
import { Row, Col, Container, Carousel, Button, Image, Form } from 'react-bootstrap';

function AboutUs() {
    return (
        <div className='AboutUs'>
            <h1>About Our Insurance</h1>
            <br></br>
            <br></br>
            <p>
              Welcome to our insurance company! We are dedicated to providing comprehensive insurance coverage that meets the needs of our customers. Our mission is to protect you and your loved ones from unexpected events, ensuring peace of mind and financial security.
              Our private liability insurance plans are designed to cover a wide range of risks, from personal injury and property damage to financial losses. We offer three levels of coverage to suit different needs and budgets, each with optional add-ons to customize your protection.
              Our team of experienced professionals is committed to offering exceptional customer service and support. Whether you need help selecting the right plan or filing a claim, we are here to assist you every step of the way.
              Choose our insurance and experience the confidence that comes with knowing you are well-protected. Thank you for considering us as your insurance provider.
            </p>
        </div>
    );
  }

  export default AboutUs;
